function saveSession(omsNumber, birthDate, schedule) {
	localStorage.setItem('omsNumber', omsNumber);
	localStorage.setItem('birthDate', birthDate);
	localStorage.setItem('schedule', schedule);
}

function dropSession() {
	localStorage.clear();
}

export const saveUserData = payload => ({
	type: 'USER_SUCCESS',
	payload: payload,
});
